import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../Css/header.css';


const Header = () => {

    
  return (
    <div className="header">
        <Container>
        <Row lg={2}>
            <Col>
                <p className='fwb'>Halo, Perkenalkan Saya,</p>
                <h1 className='fwb text-yellow'>MUHAMMAD ALVIN</h1>
                <p className='fwb'>Junior Frontend Developer</p>
            </Col>
        </Row>
        </Container>
    </div>
  );
}

export default Header;
